import React from 'react';
import img1 from './Logo/mixing.jpg';
import img2 from './Logo/programming.jpg';

const Data = [
{
	imgsrc: img1,
	title: "Mixing & Mastering",
	subtitle: "Make your sound good as u think with mixing & mastering from a good place.",
},
{
	imgsrc: img2,
	title: "Music programming",
	subtitle: "Get your fevorite background scoring and music instantly.",
}

];

export default Data;
